import React from 'react';
import s from './NotFound.module.css'
import {NavLink} from "react-router-dom";




const Dialog = (props) => {
    return (
    <div>
        {props.map(item, ()=> {return (<div><NavLink to="/dialogs/{item.num}">{item.name}</NavLink></div>)})}
    </div>
)
}

const NotFound = () => {
    return(
        <div>
            <h3><Dialog /></h3>
        </div>
    )
}

export default NotFound;
